import React, { useEffect } from "react";
import Webui from "../assets/images/trillowebui.png";
import "../styles/Webui.css";
import Aos from "aos";
import "aos/dist/aos.css";
 // core version + navigation, pagination modules:
 import Swiper, { Navigation, Pagination } from 'swiper';
 // import Swiper and modules styles
 import 'swiper/css';
 import 'swiper/css/navigation';
 import 'swiper/css/pagination';

function WebUiPage() {
  useEffect(() => {
    Aos.init({ duration: 1000 });
  }, []);

  const swiper = new Swiper('.swiper', {
    // Optional parameters
    direction: 'vertical',
    loop: true,

    // If we need pagination
    pagination: {
      el: '.swiper-pagination',
    },

    // Navigation arrows
    navigation: {
      nextEl: '.swiper-button-next',
      prevEl: '.swiper-button-prev',
    },

    // And if we need scrollbar
    scrollbar: {
      el: '.swiper-scrollbar',
    },
  });

  return (
    <div className="webuipage">
      <div
      // data-aos="fade-right"
      // data-aos-offset="300"
      // data-aos-easing="ease-in-sine"
      // className="row"
      >
        <h1 className="webuitext">Top Notch Web design</h1>
        <h2 className="webuidesc">
          We create secure and flexible web solutions tailored exclusively for
          all modern businesses where people can access services and connect
          with each other.
        </h2>
      </div>
      <div
      // data-aos="fade-right"
      // data-aos-offset="300"
      // data-aos-easing="ease-in-sine"
      >
        <div className="container">
        <div class="swiper">
          <div class="swiper-wrapper">
            <div class="swiper-slide">
              <img  src={Webui} alt="webimage" />
            </div>
            <div class="swiper-slide">

              <img className="webuiimage" src={Webui} alt="webimage" />
            </div>
            <div class="swiper-slide">
              <img className="webuiimage" src={Webui} alt="webimage" />
            </div>
          </div>

          <div class="swiper-pagination"></div>

          <div class="swiper-button-prev"></div>
          <div class="swiper-button-next"></div>

          <div class="swiper-scrollbar"></div>
        </div>
      </div>
      </div>
    </div>
  );
}

export default WebUiPage;
